/**
 * Lab Results & Testing Screen
 * At-home lab test ordering and comprehensive results visualization
 */

import React, { useState, useEffect } from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  Dimensions,
  ActivityIndicator,
  Alert,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { Ionicons } from '@expo/vector-icons';
import Svg, { Line, Circle, Path, Text as SvgText } from 'react-native-svg';
import { theme } from '../theme/theme';

const { width } = Dimensions.get('window');

interface LabTest {
  id: string;
  name: string;
  description: string;
  category: string;
  biomarkers: string[];
  price: number;
  estimatedTurnaroundDays: number;
  provider: string;
  sampleType: string;
}

interface BiomarkerResult {
  name: string;
  value: number;
  unit: string;
  referenceRange: {
    min: number;
    max: number;
    optimalMin?: number;
    optimalMax?: number;
  };
  status: 'low' | 'normal' | 'high' | 'critical';
  interpretation: string;
  trendAnalysis?: {
    previousValue?: number;
    percentChange?: number;
    trend: 'improving' | 'stable' | 'declining';
  };
}

interface LabResults {
  resultId: string;
  testName: string;
  collectionDate: Date;
  biomarkers: BiomarkerResult[];
  overallAssessment: string;
  physicianNotes?: string;
}

const LabResultsScreen: React.FC = () => {
  const [activeTab, setActiveTab] = useState<'tests' | 'results' | 'trends'>('results');
  const [isLoading, setIsLoading] = useState(true);
  const [availableTests, setAvailableTests] = useState<LabTest[]>([]);
  const [labResults, setLabResults] = useState<LabResults | null>(null);
  const [selectedBiomarker, setSelectedBiomarker] = useState<string | null>(null);

  useEffect(() => {
    loadData();
  }, []);

  const loadData = async () => {
    setIsLoading(true);

    // Simulate API calls
    setTimeout(() => {
      // Mock available tests
      setAvailableTests([
        {
          id: 'ew-metabolic',
          name: 'Comprehensive Metabolic Panel',
          description: 'Complete metabolic health assessment',
          category: 'Comprehensive',
          biomarkers: ['Glucose', 'HbA1c', 'Cholesterol', 'Liver', 'Kidney'],
          price: 149,
          estimatedTurnaroundDays: 5,
          provider: 'Everlywell',
          sampleType: 'Finger-prick',
        },
        {
          id: 'ew-heart',
          name: 'Heart Health Test',
          description: 'Cardiovascular risk markers',
          category: 'Cardiovascular',
          biomarkers: ['Cholesterol', 'Triglycerides', 'hs-CRP'],
          price: 99,
          estimatedTurnaroundDays: 5,
          provider: 'Everlywell',
          sampleType: 'Finger-prick',
        },
        {
          id: 'quest-comprehensive',
          name: 'Quest Health & Wellness Panel',
          description: '40+ biomarkers comprehensive screening',
          category: 'Comprehensive',
          biomarkers: ['CBC', 'CMP', 'Lipids', 'Thyroid', 'Vitamins'],
          price: 299,
          estimatedTurnaroundDays: 3,
          provider: 'Quest',
          sampleType: 'Blood draw',
        },
      ]);

      // Mock lab results
      setLabResults({
        resultId: 'RESULT-123',
        testName: 'Comprehensive Metabolic Panel',
        collectionDate: new Date(Date.now() - 5 * 24 * 60 * 60 * 1000),
        biomarkers: [
          {
            name: 'Glucose',
            value: 95,
            unit: 'mg/dL',
            referenceRange: { min: 70, max: 99, optimalMin: 70, optimalMax: 85 },
            status: 'normal',
            interpretation: 'Fasting glucose within normal range, indicating good blood sugar control.',
            trendAnalysis: { previousValue: 102, percentChange: -6.9, trend: 'improving' },
          },
          {
            name: 'HbA1c',
            value: 5.4,
            unit: '%',
            referenceRange: { min: 4.0, max: 5.6, optimalMin: 4.0, optimalMax: 5.0 },
            status: 'normal',
            interpretation: '3-month average blood sugar optimal. Low diabetes risk.',
            trendAnalysis: { previousValue: 5.8, percentChange: -6.9, trend: 'improving' },
          },
          {
            name: 'Total Cholesterol',
            value: 195,
            unit: 'mg/dL',
            referenceRange: { min: 0, max: 200, optimalMin: 150, optimalMax: 180 },
            status: 'normal',
            interpretation: 'Total cholesterol within desirable range.',
            trendAnalysis: { previousValue: 210, percentChange: -7.1, trend: 'improving' },
          },
          {
            name: 'LDL Cholesterol',
            value: 115,
            unit: 'mg/dL',
            referenceRange: { min: 0, max: 100, optimalMin: 0, optimalMax: 70 },
            status: 'high',
            interpretation: 'LDL slightly elevated. Consider dietary changes.',
            trendAnalysis: { previousValue: 125, percentChange: -8.0, trend: 'improving' },
          },
          {
            name: 'HDL Cholesterol',
            value: 55,
            unit: 'mg/dL',
            referenceRange: { min: 40, max: 200, optimalMin: 60, optimalMax: 100 },
            status: 'normal',
            interpretation: 'HDL acceptable. Higher levels are protective.',
            trendAnalysis: { previousValue: 52, percentChange: 5.8, trend: 'improving' },
          },
          {
            name: 'Triglycerides',
            value: 125,
            unit: 'mg/dL',
            referenceRange: { min: 0, max: 150, optimalMin: 0, optimalMax: 100 },
            status: 'normal',
            interpretation: 'Triglycerides within normal range.',
            trendAnalysis: { previousValue: 140, percentChange: -10.7, trend: 'improving' },
          },
        ],
        overallAssessment: 'normal',
        physicianNotes:
          'Overall metabolic health is good. LDL cholesterol slightly elevated - recommend dietary modifications. All other markers optimal. Continue lifestyle habits and recheck in 3 months.',
      });

      setIsLoading(false);
    }, 1000);
  };

  const getStatusColor = (status: string): string => {
    switch (status) {
      case 'low':
        return '#3b82f6';
      case 'normal':
        return '#10b981';
      case 'high':
        return '#f59e0b';
      case 'critical':
        return '#ef4444';
      default:
        return '#64748b';
    }
  };

  const getTrendIcon = (trend: string): string => {
    switch (trend) {
      case 'improving':
        return 'trending-down';
      case 'declining':
        return 'trending-up';
      default:
        return 'trending-flat';
    }
  };

  const getTrendColor = (trend: string): string => {
    switch (trend) {
      case 'improving':
        return '#10b981';
      case 'declining':
        return '#ef4444';
      default:
        return '#f59e0b';
    }
  };

  const orderTest = (testId: string) => {
    Alert.alert(
      'Order Lab Test',
      'Are you sure you want to order this test?',
      [
        { text: 'Cancel', style: 'cancel' },
        {
          text: 'Order',
          onPress: () => {
            Alert.alert('Success', 'Test ordered successfully! Kit will ship within 24 hours.');
          },
        },
      ]
    );
  };

  const renderBiomarkerChart = (biomarker: BiomarkerResult) => {
    const chartWidth = width - 80;
    const chartHeight = 100;

    const { value, referenceRange } = biomarker;
    const min = referenceRange.optimalMin || referenceRange.min;
    const max = referenceRange.optimalMax || referenceRange.max;
    const range = max - min;
    const normalizedValue = ((value - min) / range) * chartWidth;

    const optimalStart = referenceRange.optimalMin
      ? ((referenceRange.optimalMin - min) / range) * chartWidth
      : 0;
    const optimalEnd = referenceRange.optimalMax
      ? ((referenceRange.optimalMax - min) / range) * chartWidth
      : chartWidth;

    return (
      <View style={styles.biomarkerChartContainer}>
        <Svg width={chartWidth} height={chartHeight}>
          {/* Reference range bar */}
          <Line
            x1={0}
            y1={50}
            x2={chartWidth}
            y2={50}
            stroke="#e2e8f0"
            strokeWidth="8"
            strokeLinecap="round"
          />

          {/* Optimal range */}
          <Line
            x1={optimalStart}
            y1={50}
            x2={optimalEnd}
            y2={50}
            stroke="#d1fae5"
            strokeWidth="8"
            strokeLinecap="round"
          />

          {/* Current value indicator */}
          <Circle cx={Math.min(chartWidth, Math.max(0, normalizedValue))} cy={50} r="12" fill={getStatusColor(biomarker.status)} />
          <Circle cx={Math.min(chartWidth, Math.max(0, normalizedValue))} cy={50} r="6" fill="#fff" />

          {/* Range labels */}
          <SvgText x={0} y={75} fontSize="10" fill="#64748b">
            {min}
          </SvgText>
          <SvgText x={chartWidth} y={75} fontSize="10" fill="#64748b" textAnchor="end">
            {max}
          </SvgText>
        </Svg>
      </View>
    );
  };

  if (isLoading) {
    return (
      <View style={styles.loadingContainer}>
        <ActivityIndicator size="large" color="#10b981" />
        <Text style={styles.loadingText}>Loading lab data...</Text>
      </View>
    );
  }

  return (
    <View style={styles.container}>
      {/* Header */}
      <LinearGradient colors={theme.gradients.primary.colors} style={styles.header}>
        <Text style={styles.headerTitle}>Lab Tests & Results</Text>
        <Text style={styles.headerSubtitle}>At-home CLIA-certified testing</Text>
      </LinearGradient>

      {/* Tab Selector */}
      <View style={styles.tabContainer}>
        <TouchableOpacity
          style={[styles.tab, activeTab === 'tests' && styles.tabActive]}
          onPress={() => setActiveTab('tests')}
        >
          <Ionicons name="flask" size={20} color={activeTab === 'tests' ? '#10b981' : '#64748b'} />
          <Text style={[styles.tabText, activeTab === 'tests' && styles.tabTextActive]}>Order Tests</Text>
        </TouchableOpacity>

        <TouchableOpacity
          style={[styles.tab, activeTab === 'results' && styles.tabActive]}
          onPress={() => setActiveTab('results')}
        >
          <Ionicons name="document-text" size={20} color={activeTab === 'results' ? '#10b981' : '#64748b'} />
          <Text style={[styles.tabText, activeTab === 'results' && styles.tabTextActive]}>Results</Text>
        </TouchableOpacity>

        <TouchableOpacity
          style={[styles.tab, activeTab === 'trends' && styles.tabActive]}
          onPress={() => setActiveTab('trends')}
        >
          <Ionicons name="trending-up" size={20} color={activeTab === 'trends' ? '#10b981' : '#64748b'} />
          <Text style={[styles.tabText, activeTab === 'trends' && styles.tabTextActive]}>Trends</Text>
        </TouchableOpacity>
      </View>

      <ScrollView style={styles.scrollView} showsVerticalScrollIndicator={false}>
        {/* Order Tests Tab */}
        {activeTab === 'tests' && (
          <View>
            {availableTests.map((test) => (
              <View key={test.id} style={styles.testCard}>
                <View style={styles.testHeader}>
                  <View style={styles.providerBadge}>
                    <Text style={styles.providerText}>{test.provider}</Text>
                  </View>
                  <View style={styles.categoryBadge}>
                    <Text style={styles.categoryText}>{test.category}</Text>
                  </View>
                </View>

                <Text style={styles.testName}>{test.name}</Text>
                <Text style={styles.testDescription}>{test.description}</Text>

                <View style={styles.biomarkersContainer}>
                  <Ionicons name="water" size={16} color="#10b981" />
                  <Text style={styles.biomarkersText}>{test.biomarkers.length} Biomarkers:</Text>
                  <Text style={styles.biomarkersList}>{test.biomarkers.join(', ')}</Text>
                </View>

                <View style={styles.testDetails}>
                  <View style={styles.detailItem}>
                    <Ionicons name="calendar" size={16} color="#64748b" />
                    <Text style={styles.detailText}>{test.estimatedTurnaroundDays} days</Text>
                  </View>
                  <View style={styles.detailItem}>
                    <Ionicons name="finger-print" size={16} color="#64748b" />
                    <Text style={styles.detailText}>{test.sampleType}</Text>
                  </View>
                  <View style={styles.detailItem}>
                    <Ionicons name="cash" size={16} color="#10b981" />
                    <Text style={styles.priceText}>${test.price}</Text>
                  </View>
                </View>

                <TouchableOpacity style={styles.orderButton} onPress={() => orderTest(test.id)}>
                  <LinearGradient colors={theme.gradients.primary.colors} style={styles.orderButtonGradient}>
                    <Ionicons name="cart" size={20} color="#fff" />
                    <Text style={styles.orderButtonText}>Order Test</Text>
                  </LinearGradient>
                </TouchableOpacity>
              </View>
            ))}
          </View>
        )}

        {/* Results Tab */}
        {activeTab === 'results' && labResults && (
          <View>
            {/* Overall Assessment */}
            <View style={styles.assessmentCard}>
              <View style={styles.assessmentHeader}>
                <Ionicons name="checkmark-circle" size={32} color="#10b981" />
                <View style={styles.assessmentInfo}>
                  <Text style={styles.assessmentTitle}>Overall Assessment</Text>
                  <Text style={styles.assessmentStatus}>
                    {labResults.overallAssessment.toUpperCase()}
                  </Text>
                </View>
              </View>

              <Text style={styles.testNameText}>{labResults.testName}</Text>
              <Text style={styles.collectionDateText}>
                Collected: {labResults.collectionDate.toLocaleDateString()}
              </Text>

              {labResults.physicianNotes && (
                <View style={styles.physicianNotesCard}>
                  <View style={styles.physicianHeader}>
                    <Ionicons name="medical" size={20} color="#3b82f6" />
                    <Text style={styles.physicianTitle}>Physician Notes</Text>
                  </View>
                  <Text style={styles.physicianNotes}>{labResults.physicianNotes}</Text>
                </View>
              )}
            </View>

            {/* Biomarker Results */}
            <Text style={styles.sectionTitle}>Biomarker Results</Text>

            {labResults.biomarkers.map((biomarker, index) => (
              <View key={index} style={styles.biomarkerCard}>
                <View style={styles.biomarkerHeader}>
                  <View style={styles.biomarkerTitleRow}>
                    <Text style={styles.biomarkerName}>{biomarker.name}</Text>
                    <View style={[styles.statusBadge, { backgroundColor: getStatusColor(biomarker.status) + '20' }]}>
                      <Text style={[styles.statusText, { color: getStatusColor(biomarker.status) }]}>
                        {biomarker.status.toUpperCase()}
                      </Text>
                    </View>
                  </View>

                  <View style={styles.biomarkerValueRow}>
                    <Text style={[styles.biomarkerValue, { color: getStatusColor(biomarker.status) }]}>
                      {biomarker.value}
                    </Text>
                    <Text style={styles.biomarkerUnit}>{biomarker.unit}</Text>
                  </View>
                </View>

                {renderBiomarkerChart(biomarker)}

                <View style={styles.referenceRow}>
                  <Text style={styles.referenceText}>
                    Reference: {biomarker.referenceRange.min}-{biomarker.referenceRange.max} {biomarker.unit}
                  </Text>
                  {biomarker.referenceRange.optimalMin && (
                    <Text style={styles.optimalText}>
                      Optimal: {biomarker.referenceRange.optimalMin}-{biomarker.referenceRange.optimalMax}{' '}
                      {biomarker.unit}
                    </Text>
                  )}
                </View>

                <Text style={styles.interpretationText}>{biomarker.interpretation}</Text>

                {biomarker.trendAnalysis && (
                  <View style={styles.trendContainer}>
                    <Ionicons
                      name={getTrendIcon(biomarker.trendAnalysis.trend)}
                      size={20}
                      color={getTrendColor(biomarker.trendAnalysis.trend)}
                    />
                    <Text style={styles.trendText}>
                      {biomarker.trendAnalysis.percentChange > 0 ? '+' : ''}
                      {biomarker.trendAnalysis.percentChange.toFixed(1)}% vs. previous
                    </Text>
                    <View
                      style={[
                        styles.trendBadge,
                        { backgroundColor: getTrendColor(biomarker.trendAnalysis.trend) + '20' },
                      ]}
                    >
                      <Text style={[styles.trendBadgeText, { color: getTrendColor(biomarker.trendAnalysis.trend) }]}>
                        {biomarker.trendAnalysis.trend}
                      </Text>
                    </View>
                  </View>
                )}
              </View>
            ))}

            {/* Download Report */}
            <TouchableOpacity style={styles.downloadButton}>
              <Ionicons name="download" size={20} color="#3b82f6" />
              <Text style={styles.downloadText}>Download Full Report (PDF)</Text>
            </TouchableOpacity>
          </View>
        )}

        {/* Trends Tab */}
        {activeTab === 'trends' && labResults && (
          <View>
            <Text style={styles.sectionTitle}>6-Month Biomarker Trends</Text>

            {labResults.biomarkers
              .filter((b) => b.trendAnalysis)
              .map((biomarker, index) => (
                <View key={index} style={styles.trendCard}>
                  <View style={styles.trendCardHeader}>
                    <Text style={styles.trendCardTitle}>{biomarker.name}</Text>
                    <Ionicons
                      name={getTrendIcon(biomarker.trendAnalysis!.trend)}
                      size={24}
                      color={getTrendColor(biomarker.trendAnalysis!.trend)}
                    />
                  </View>

                  <View style={styles.trendStatsRow}>
                    <View style={styles.trendStat}>
                      <Text style={styles.trendStatLabel}>Previous</Text>
                      <Text style={styles.trendStatValue}>{biomarker.trendAnalysis!.previousValue}</Text>
